import React, { useEffect, useState } from 'react';
import Link from 'next/link';
import { Button } from 'antd';
import Header from '../components/HtmlHeader';
import { WithComponent ,Iprops} from '../utils/commonsStore';

const Home = (props:Iprops) => {
    // const [count, setCount] = useState(0);
    console.log(props)
    props.dispatch({type:'index/inited'})
    const { index } = props;
    const { name, count } = index;
    return (
        <>你好啊洗吧<br />
            <Header />
            {count}
            <Button onClick={() => props.dispatch({ type: 'index/caculate', delta: 1 })}>加1</Button>
            <Link href='/user'>
                <a>去user</a>
            </Link>
            {name}
        </>
    )
};
export default WithComponent(Home, () => {
    return new Promise((res)=>{
        setTimeout(() => {
            res({a:67})
        }, 3000);
    })
});;
